import React from 'react'
import Header from './components/Header.js'
import './styles/bootstrap.min.css';
import Footer from './components/Footer.js';
import TextBox from './components/TextBox.js'
import './styles/App.css'

function App(props) {
  return (
    <div>
        <Header />
        <center>
          <div class="entry-text">Select the countries which laws will be compared.</div>
        </center>
        <TextBox first={props.state.firstCountry} second={props.state.secondCountry} countriesSelected={props.countriesSelected}/>
        <Footer />
    </div>
  );
}

export default App
